description:
&lt;p&gt;UNIS Vienna promotes the work of the United Nations family based in Vienna through the media, governmental and non-governmental organizations, and public outreach work.&lt;/p&gt;
&lt;p&gt;UNIS serves as an information centre for Austria, Hungary, Slovakia and Slovenia, promoting the work of the United Nations as a whole by means of information programmes and actvities.&lt;/p&gt;
&lt;p&gt;UNIS also offers guided tours and lectures through the Visitors Service.&lt;/p&gt;
